import React, { useState, useEffect } from 'react';
import { getSingleStory } from '../../../services/hackerNewsApi';

const Story = ({storyId, storyKey }) => {
  const [storyData, setStoryData] = useState({});

  useEffect(() => {
    getSingleStory(8863).then(storyData => storyData && storyData.url && setStoryData(storyData))
  }, []);


  return storyId && storyId.url
    ? (
      <div key={storyKey}>
        <p>{storyId.title}</p>
      </div>
    )
    : <div key={storyKey}>gundeep</div>
}

export default Story;
